[include include/*.cfg]
[printer]
kinematics: corexy           
max_velocity: 800            
max_accel: 20000          
#max_accel_to_decel: 10000 # deprecated
minimum_cruise_ratio: 0.5
max_z_velocity: 200 #20           
max_z_accel: 1000             
square_corner_velocity: 10.0 

[verify_heater extruder]      
max_error: 120                
check_gain_time:30           
hysteresis: 5                
heating_gain: 2               

[verify_heater heater_bed]      
max_error: 120                
check_gain_time:60           
hysteresis: 5                
heating_gain: 2 

[quad_gantry_level]          
gantry_corners:
	-60,-10
	410,420
#	Probe points
points:
	50,25
	50,275
	300,275
	300,25
speed: 300                   
horizontal_move_z: 10      
retry_tolerance: 0.0100      
retries: 12                
max_adjust: 30   
adaptive_horizontal_move_z: True

[input_shaper]
damping_ratio_x: 0.058
damping_ratio_y: 0.052
shaper_type_x: 3hump_ei  
shaper_freq_x: 119.6
shaper_type_y: mzv
shaper_freq_y: 44

[save_variables]
filename = ~/printer_data/config/saved_variables.cfg

[bed_mesh]
speed: 300                   
horizontal_move_z: 4         
mesh_min: 20,30              
mesh_max: 330,320            
probe_count: 64,64             
algorithm: bicubic   
bicubic_tension: 0.4
split_delta_z: 0.016
mesh_pps:3,3
adaptive_margin: 5
#fade_start: 0
#fade_end: 10
#fade_target: 0

[delayed_gcode bed_mesh_init]
initial_duration: .01
gcode:
  BED_MESH_PROFILE LOAD=default

